import React, { Component } from 'react';
import { render } from 'react-dom';

import 'antd/es/date-picker/style/css';
import InputLabel from '../../components/InputLabel.js'
import Lista from '../../components/Lista.js'

class Visualizar extends Component {

  constructor(props){
    super(props)

    this.state = {
      obj: [],
      a: "a"
    }

    this.setState({obj: [
    {
      nome: 'item1',
      local: 'local1'
    },
    {
      nome: 'item2',
      local: 'local2'
    },
    {
      nome: 'item2',
      local: 'local2'
    },
    {
      nome: 'item2',
      local: 'local2'
    },
    {
      nome: 'item2',
      local: 'local2'
    },
    {
      nome: 'item2',
      local: 'local2'
    }]});
  }

  render() {

    return (
      <div className = "Background">
        {this.state.a}
          <Lista itens = {this.state.obj} tam = {this.state.obj.length}/>  
      </div>
    );
  }
}

export default Visualizar;
